def dpdq(dp,dq,p,q,c):
    n = p*q
    m1 = gmpy2.powmod(c,dq,q)
    m2 = gmpy2.powmod(c,dp,p)
    qi = gmpy2.invert(q,p)
    m = (m1+(((m2-m1)*qi)%p)*q)%n

    return long_to_bytes(m)
